  // Find a user without bank accounts or remove bank accounts from current user

  cy.database("find", "users").then((users: User[]) => {
    // Login with the first user

    const firstUser = users[0];

    // Check if this user has bank accounts

    cy.database("find", "bankaccounts", {
      userId: firstUser.id
    }).then(bankAccounts => {
      // If user has bank accounts, delete them

      if (bankAccounts && bankAccounts.length > 0) {
        bankAccounts.forEach(account => {
          cy.database("delete", "bankaccounts", {
            id: account.id
          });
        });
      }

      // Login with the user

      cy.loginByXstate(firstUser.username);

      // Navigate to bank accounts page

      cy.getBySel("sidenav-bankaccounts").click();

      // Wait for the list bank accounts query

      cy.wait("@gqlListBankAccountQuery");

      // Verify that the bank accounts list is not visible

      cy.getBySel("bankaccount-list").should("not.exist");

      // Verify that empty state elements are displayed

      cy.getBySel("empty-list-header").should("be.visible");

      // Verify that the onboarding modal is shown

      cy.getBySel("user-onboarding-dialog").should("be.visible");
    });
  });

// Find a transaction created by User B

  cy.database("find", "transactions", {
    senderId: ctx.userB.id
  }).then(transaction => {
    // Login as User A

    cy.loginByXstate(ctx.userA.username);

    // Navigate to User B's transaction

    cy.visit(`/transaction/${transaction.id}`);

    // Add a comment to the transaction

    const commentText = "This is a test comment from User A";
    cy.getBySel("comment-input").type(commentText);
    cy.getBySel("comment-submit").click();

    // Wait for comment to be posted

    cy.wait("@postComment");

    // Verify the comment appears on the page

    cy.getBySel("comments-list").should("contain", commentText);

    // Logout User A

    cy.getBySel("sidenav-signout").click();

    // Login as User B

    cy.loginByXstate(ctx.userB.username);

    // Navigate to notifications

    cy.getBySel("sidenav-notifications").click();
    cy.wait("@getNotifications");

    // Verify User B has a notification about User A's comment

    cy.getBySel("notification-list-item").first().should("contain", ctx.userA.firstName).and("contain", "commented");
  });

// Navigate to bank accounts page

  cy.getBySel("sidenav-bankaccounts").click();

  // Click on the new bank account button

  cy.getBySel("bankaccount-new").click();

  // Fill in the bank account form with provided test data

  cy.getBySel("bankaccount-bankName-input").type(bankAccountInfo.bankName);
  cy.getBySel("bankaccount-routingNumber-input").type(bankAccountInfo.routingNumber);
  cy.getBySel("bankaccount-accountNumber-input").type(bankAccountInfo.accountNumber);

  // Submit the form

  cy.getBySel("bankaccount-submit").click();

  // Wait for the GraphQL mutation to complete

  cy.wait("@gqlCreateBankAccountMutation");

  // Verify the newly created bank account is visible in the list

  cy.getBySel("bankaccount-list").should("be.visible");
  cy.contains(bankAccountInfo.bankName).should("be.visible");

  // Verify account details are displayed correctly

  cy.contains(bankAccountInfo.accountNumber).should("be.visible");

// Check if we have a pending transaction request to work with

  cy.wrap(ctx.transactionRequest).should("exist").then(() => {
    // Navigate to the transaction detail view

    cy.visit(`/transaction/${ctx.transactionRequest!.id}`);
    cy.wait("@getTransaction");

    // Verify the transaction request status is pending before rejection

    cy.getBySel("transaction-detail-header").should("be.visible");
    cy.getBySel("transaction-status").should("contain", "pending");
    cy.getBySel("transaction-action-button").should("have.length", 2);

    // Click the reject button

    cy.getBySel("transaction-reject-request").click();

    // Wait for the update request to complete

    cy.wait("@updateTransaction");

    // Verify the transaction status is now rejected

    cy.getBySel("transaction-status").should("contain", "rejected");
    cy.getBySel("transaction-action-button").should("not.exist");

    // Verify rejection appears in activity feed

    cy.getBySel("transaction-detail-header").should("contain", "rejected");
  });

